shop etc), Future lifestyle fashion ( for central and brand factory). Future enterprises is for non-retail business like future generali etc'),('Retail','Future Retail ','FRETAIL','1','Future Retail (for big bazaar, kirana, easyday etc). Future group is very confused and has too many listed companies for the same purpose without much differentiaion : Future Retail (for big bazaar, easy day, kb fair price etc), Future lifestyle fashion for central and brand factory. future supply chain for logistics. Future enterprises is for non-retail business like future generali etc. Praxis Home solution as a spin-off from hometown and fabfurnish. Future Consumer is for branding of FMCG products. Too many tie-ups with many companies like celio and sketchers but head company is unkown. Future group is not listed as an umbrella group. Why did Niligiri retail and aadhaar retail go to Future consumer etc? Can such a group have so many listed companies without differntiation? How many listed companies walmart has?'),('Retail','Shoppers Stop','SHOPERSTOP','0','Shoppers Stop. Retails stores by RPG Group. It was dumped in between. To be revieweed later.'),('Retail','Trent','TRENT','1','Trent (JV of Tata and Tesco: operates star bazzar, star daily etc)'),('Rubber','Apar Industries','','0','Apar Industries (How is it related to rubber ?)'),('Rubber','COSCO INDIA','','0','COSCO INDIA (very small player in rubber : Requires more analysis) : Volleyball (Sponsor of equipment for all Indian major tournament)'),('Shipping','Cochin Shipyard Ltd','COCHINSHIP','0','Cochin Shipyard Ltd (Largest ship building company in India : Cochin Shipyard Limited is the largest shipbuilding and maintenance facility in India) : TBB'),('Shipping','Great Eastern Shipping','GESHIP','0','Great Eastern Shipping'),('Shipping','Shipping Corporation','SCI','1','Shipping Corporation - CPSE Navaratna (Transporation on Vessel) : 80 ships & 5.9 Million Tons (Dead weight). NOTE: Bought by mistake. Doesn\'t pay any dividend and revenue is flat for last 10 years. Need to EXIT. Why revenues are not growing? why no dividend?'),('Steel - Large','JSW Steel','JSWSTEEL','1','JSW Steel ( India\'s biggest steel maker. 15% stake is owned by JFE ... JFE is worlds 6th largest steel maker and Japanese biggest steel maker formed by merging NKK steel and Kawasaki steel). JSW group has two other listed companies as well JSW Energy (power) and JSW holdings (NBFC). JSW is trying to enter into other sectors as well using infrastructure, cements and paints using JSW Infrastructure, JSW cements and JSW paints but none of these are listed.'),('Steel - Large','SAIL','SAIL','0','SAIL (Steel Authority of India Limited) - CPSE MAHARATNA. It is making losses for last 2 years and no dividend payout also. Sold everything on 29-12-2017'),('Steel - Large','Tata Steel','TATASTEEL','1','Tata Steel (merged with Thyssenkrupp in Germany, Europe).'),('Sugar','Balrampur Chini Mills','BALRAMCHIN','1','Balrampur Chini Mills (Chini.com)'),('Sugar','EID Parry','EIDPARRY','1','EID Parry (East India Distilleries, a Subsidiary of Murugappa group). It has branded a commodity (Parry\'s Sugar)'),('Sugar','Shree Renuka Sugars','RENUKA','0','Shree Renuka Sugar (Branded Commodity : Madhur pure & hygeinic Sugar) ... Net profit is in negative... Net Sales is high may be due to discounts. Largest player in India and Brazil. Production full year due to complementary seasons in India and Brazil. Acquired by Wilmar International that has JV with Adani in other things like Oil (Fortune brand). Kanakashree Agro is India\'s largest sugar refiner and ethanol producer based in Mumbai, Maharashtra, with refining capacity of 4000 tonnes/day and distillery capacity of 600 kilolitre/day. Dumped due to high debt/equity.'),('Sugar','Bajaj Hindustan','','0','Bajaj Hindustan (Bajaj group company, splited from bajaj holdings and investments that owns just bajaj auto and bajaj finance services) Sishir Bajaj group. Bajaj Hindusthan has 14 sugar mills with cane crushing capacity of 1.36 lakh tonnes per day and alcohol distillation capacity of 800 kilo litres per day.'),('Telecommunications - Equipment','Honeywell Automation ','HONAUT','1','Honeywell Automation (MNC, Honeywell Aerospace is a world leader in aviation. Supplies all components of aircraft. Its competitor is UTC-United Technologies corporation in aviation space. Both are US based companies. It is also into building automation, plant automation, hotel automation etc. It also has speciality paint for aircraft and textile for miliary. High Share Price : 12 K.'),('Telecommunications - Equipment','Bharti Infratel ','INFRATEL','1','Bharti Infratel (Telecom tower company with 40K towers, It also has 45% stake in Indus tower - combined entity of Bharti, Vodafone and Idea. also - 1.2 Lac towers). Bharti Infratel is 10% owned by KKR - Kohlberg Kravis & Roberts group. Key metric is number of towers and tower tenancy ... tower tenancy of 2 to 3 is good. As number of players have come down to just 3 ... it will be difficult to have more than tenacy ratio of 2.'),('Telecommunications - Service','Bharti Airtel','BHARTIARTL','1','Bharti Airtel'),('Telecommunications - Service','Idea','IDEA','1','Vodafone Idea (part owner Vodafone is one of worlds largest Telecomm company).'),('Textiles - Denim','Arvind Fashions','ARVINDFASN','1','Arvind Fashions Limited (company of Lal Bhai group. Own Brands: Flying Machine, Newport, Quads, Ruf & Tuf, Excalibur) Licensed Brands : Arrow, Gap Inc., Lee, Wrangler, Twills, Gant U.S.A., Tommy Hilfiger, EdHardy, Izod, Cherokee, Mossimo, U.S. Polo Assn., Billabong, Nautica, Aeropostale.'),('Textiles - Readymade Apparels','Page Industries ','PAGEIND','1','Page Industries (Jockey, Speedo) : High Share Price : 15K'),('Textiles - Woollen & Worsted','Raymond ','','0','Raymond (Brands : Raymond, ColorPlus, Park Avenue, Parx, KamaSutra)'),('Trading','Adani Enterprises ','ADANIENT','1','Adani Enterprises (Check AR and segmented results). Ruchi soya went in